import Layout from "../components/layout";

export default () => (
    <Layout>
    <div>
    <h1>About BitzPrice</h1>
    <p>BitzPrice is a startup in Lagos Nigeria that is dedicated to providing
       bitcoin customers with easy conversion solution to their currency of 
       choice and also gives them a market analysis of the crypto currency 
       market.  
    </p>
    </div>
    </Layout>
);
